import React from "react";
import Post from "../components/Post";
import Header from "../components/Header";
import { Link } from "react-router-dom";

const Routes = () => {
  return (
    <main>
      <Header />
      <Post />
      <Post />
      <Post />
    </main>
  );
};

export default Routes;
